INSERT INTO `centralcar`.`fw_metodos` (`id_metodo`,`controlador`,`metodo`,`nombre`,`descripcion`,`user_alta`,`user_mod`,`fecha_alta`,`fecha_mod`) VALUES (1, 'Area', 'index', 'Indice', 'No tiene accion asignada envia a un error 404', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(2, 'Area', 'select_area', 'Seleccionar areas', 'Muestra un combo de seleccion con las areas', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(3, 'Controllers', 'index', 'Indice', 'Muestra la tabla con los metodos que se pueden relacionar a los roles', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(4, 'Controllers', 'obtener_controllers', 'Lista de Controladores', 'Realiza la peticion al modelo para obtener la lista de modelos', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(5, 'Controllers', 'data_controller', 'Modal Metodos', 'Solicita una ventana modal para la edicion de metodos', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(6, 'Controllers', 'editar_metodo', 'Editar Metodo', 'Envia los datos para editar el metodo', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(7, 'Controllers', 'modal_add_metodo', 'Modal Agregar Metodo', 'Solicita una modal para el alta de un nuevo par Controlador - Metodo', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(8, 'Controllers', 'agregar_metodo', 'Agregar Metodo', 'Envia datos para un nuevo par de Controlador - Metodo', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(9, 'Controllers', 'eliminar_par', 'Elimina Metodo', 'Envia la peticion para eliminar el par Controlador - Metodo, eta accion elimina en cascada los identificadores que se ligaron dentro de la tabla permisos', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(10, 'Extensions', 'init', 'Inicializa las extensiones', 'Clase principal que permite inicializar las extensiones', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(11, 'Inicio', 'index', 'Ventana Principal', 'Muestra la ventana principal que se muestra al usuario despues de loguearse', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(12, 'Login', 'salir', 'Salir', 'Sale del sistema, es necesario hacer universal para todos los usuarios', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(13, 'Roles', 'index', 'Indice', 'No tiene accion asignada envia a un error 404', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(14, 'Roles', 'modal_roles', 'Modal Roles', 'Muestra una ventana modal donde se listan los Roles', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(15, 'Roles', 'agregar_rol', 'Inserta Nivel', 'Inserta un nuevo nivel o rol a la lista de roles del sistema', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(16, 'Roles', 'permisos', 'Administracion de permisos', 'Pagina donde se listan todos los permisos para asignarlos a los roles', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(17, 'Roles', 'establecer_permiso', 'Setear permiso', 'Setea el permiso de una actividad en true o false', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(18, 'Roles', 'clonar', 'Clonar roles', 'clona los permisos de un rol a otro para facilitar la creacion de roles basados en uno ya establecido', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(19, 'Ubicacion', 'index', 'Indice', 'No tiene accion asignada envia a un error 404', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(20, 'Ubicacion', 'obtener_ubicaciones', 'Obtiene ubicaciones', 'Obtiene un arreglo con las ubicaciones', 0, 1, '0000-00-00 00:00:00', '2015-10-08 14:13:31'),(21, 'Usuarios', 'index', 'Indice', 'Muestra la lista de los usuarios del sistema', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(22, 'Usuarios', 'obtener_usuarios', 'Lista de usuarios', 'Obtiene los datos de todos los usuarios para presentarlos en una lista para su administracion', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),(23, 'Usuarios', 'datos_usuario', 'Datos de usuario', 'Obtiene los datos de un usuario en particular para mostrarlo en una ventana modal', 0, 0, '0000-00-00 00:00:00', '00